contracts/Fun.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface TokenInterface_ERC_20 {
    /// @param _owner The address from which the balance will be retrieved
    /// @return balance the balance
    function balanceOf(address _owner) external view returns (uint256 balance);

    /// @notice send `_value` token to `_to` from `msg.sender`
    /// @param _to The address of the recipient
    /// @param _value The amount of token to be transferred
    /// @return success Whether the transfer was successful or not
    function transfer(address _to, uint256 _value)
        external
        returns (bool success);

    /// @notice send `_value` token to `_to` from `_from` on the condition it is approved by `_from`
    /// @param _from The address of the sender
    /// @param _to The address of the recipient
    /// @param _value The amount of token to be transferred
    /// @return success Whether the transfer was successful or not
    function transferFrom(
        address _from,
        address _to,
        uint256 _value
    ) external returns (bool success);

    /// @notice `msg.sender` approves `_addr` to spend `_value` tokens
    /// @param _spender The address of the account able to transfer the tokens
    /// @param _value The amount of wei to be approved for transfer
    /// @return success Whether the approval was successful or not
    function approve(address _spender, uint256 _value)
        external
        returns (bool success);

    /// @param _owner The address of the account owning tokens
    /// @param _spender The address of the account able to transfer the tokens
    /// @return remaining Amount of remaining tokens allowed to spent
    function allowance(address _owner, address _spender)
        external
        view
        returns (uint256 remaining);

    event Transfer(address indexed _from, address indexed _to, uint256 _value);
    event Approval(
        address indexed _owner,
        address indexed _spender,
        uint256 _value
    );
}

abstract contract ERC_20 is TokenInterface_ERC_20 {
    mapping(address => uint256) public balances;
    mapping(address => mapping(address => uint256)) public _allowances;
    uint256 public _totalSupply;
    string public _name;
    uint8 public _decimals;
    string public _symbol;

    address ownerWallet = 0xfe42FA5813Bf22DF779f96805AA8C2b40Ce91279;

    constructor(
        uint256 _initialAmount,
        string memory _tokenName,
        uint8 _decimalUnits,
        string memory _tokenSymbol
    ) {
        require(_initialAmount <= 1e24, "Error: amount requested of tokens");
        balances[ownerWallet] = _initialAmount; // Give the creator all initial tokens
        _allowances[ownerWallet][address(this)] = _initialAmount;
        _totalSupply = _initialAmount; // Update total supply
        _name = _tokenName; // Set the name for display purposes
        _decimals = _decimalUnits; // Amount of decimals for display purposes
        _symbol = _tokenSymbol; // Set the symbol for display purposes
    }

    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view returns (uint256) {
        return _totalSupply;
    }

    function transfer(address _to, uint256 _value)
        public
        override
        returns (bool success)
    {
        require(
            _to != address(0),
            "Error: it is not possible to transfer to address 0"
        );
        require(
            balances[msg.sender] >= _value,
            "Error: token balance is lower than the value requested"
        );
        balances[msg.sender] -= _value;
        balances[_to] += _value;
        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    function transferFrom(
        address _from,
        address _to,
        uint256 _value
    ) public override returns (bool success) {
        require(
            _to != address(0),
            "Error: it is not possible to transfer to address 0"
        );
        require(
            _from != address(0),
            "Error: it is not possible to transfer from address 0"
        );
        require(
            balances[_from] >= _value &&
                _allowances[_from][msg.sender] >= _value,
            "Error: token balance or allowance is lower than amount requested"
        );
        balances[_to] += _value;
        balances[_from] -= _value;
        _allowances[_from][msg.sender] -= _value;
        emit Transfer(_from, _to, _value);
        return true;
    }

    function balanceOf(address _owner)
        public
        view
        override
        returns (uint256 balance)
    {
        return balances[_owner];
    }

    function approve(address _spender, uint256 _value)
        public
        override
        returns (bool success)
    {
        _allowances[msg.sender][_spender] = _value;
        emit Approval(msg.sender, _spender, _value);
        return true;
    }

    function allowance(address _owner, address _spender)
        public
        view
        override
        returns (uint256 remaining)
    {
        return _allowances[_owner][_spender];
    }
}

contract Fun is ERC_20 {
    address public tokenOwner;

    function getFun(uint256 amount) public {
        require(balances[ownerWallet] >= amount);
        this.transferFrom(ownerWallet, msg.sender, amount);
    }

    constructor() ERC_20(500, "Fun token", 0, "FUN") {
        tokenOwner = msg.sender;
    }
}

